import React from "react";
import "./style.css";

function Home() {
  return (
    <div>
      <header className="header">
        <div className="toolbar">
          <div>
           <span>Logo</span>
          </div>
          <div>
            <button>TIPO</button>
            <button>Criar</button>
          </div>
          </div >
        </header >
      <main>Corpo</main>
    </div >
  );
}

export default Home;
